def vdd_vth_to_vbody(vdd, vth):
    vdd_lst = PMOS_vdd_map.keys()
    if vdd not in vdd_lst:
        raise ValueError(f"invalid vdd, valid list: {vdd_lst}")
    
    body_vth = PMOS_vdd_map[vdd]
    for body_i, vth_i in body_vth:
        if abs(vth_i) >= vth:
            return body_i
    raise LookupError("excessive vth")

def vdd_vbody_to_vth(vdd, vbody):
    vdd_lst = PMOS_vdd_map.keys()
    if vdd not in vdd_lst:
        raise ValueError(f"invalid vdd, valid list: {vdd_lst}")
    
    body_vth = PMOS_vdd_map[vdd]
    for body_i, vth_i in body_vth:
        if vbody <= body_i:
            return abs(vth_i)
    raise LookupError("excessive vbody")

